    private async Task OnEditInfo()
    {
        loading1 = true;
        Response res = await Http.GetFromJsonAsync<Response>("Api/User/IsUserExist?username=" + editUser.UserName);
        if (res.Msg == "Yes" && editUser.UserName.ToLower() != editUser.UserName.ToLower())
